[fan_generic fan0] #[fan] #
##	Print Cooling Fan - PF8
pin: PF8 #turbo
max_power: 1
cycle_time: 0.002
hardware_pwm: false
shutdown_speed: 0
off_below: 0.12

#[heater_fan hotend_fan]
###	Hotend Fan - FAN0 Connector
### in case of a watercooler that is 24V use a Heater Pin like PF7 Heat3 for a larger mosfet that can handle more amps.
#pin: PA3 #cerpadlo
#max_power: 1
#kick_start_time: 0.5
#heater: extruder
#heater_temp: 50.0

#[fan_generic Exhaust_fan]
##  exhaust fan - In FAN4
#pin: PA15
#max_power: 1
#shutdown_speed: 0
#kick_start_time: 0.1
#off_below: 0.10

#[fan_generic chamber_fan]
###  chamber fan - In FAN9 Positon
#pin: PD15
#max_power: 1
#shutdown_speed: 0
#kick_start_time: 0.1
#off_below: 0.10

[multi_pin static_multi_pin]
pins: PA0, PA1
#   A comma separated list of pins associated with this alias. This
#   parameter must be provided

[fan_generic fan2]
##  RSCS Fans - In FAN1 Positon
pin = multi_pin:static_multi_pin
max_power: 1
shutdown_speed: 0
kick_start_time: 0.1
off_below: 0.06

[multi_pin filtration_multi_pin]
pins: PB10, PD12
#   A comma separated list of pins associated with this alias. This
#   parameter must be provided

[fan_generic fan3]
##  RSCS Fans - In FAN1 Positon
pin = multi_pin:filtration_multi_pin
max_power: 1
shutdown_speed: 0
kick_start_time: 0.1
off_below: 0.06

[gcode_macro M106]
gcode:
    {% set fan = 'fan' + (params.P|int if params.P is defined else 0)|string %}
    {% set speed = (params.S|float / 255 if params.S is defined else 1.0) %}
    SET_FAN_SPEED FAN={fan} SPEED={speed}

[gcode_macro FANS_OFF]
gcode:
  SET_FAN_SPEED FAN=fan0 SPEED=0
  SET_FAN_SPEED FAN=fan2 SPEED=0
  SET_FAN_SPEED FAN=fan3 SPEED=0

[fan_generic water_pump] 
# This is if you connect your driver fan to Super8 
#or if you want to add fan to the Super8. Other wise connect them in the driver fan ports
#stepper: stepper_x
#stepper: stepper_x1
#stepper: stepper_y
#stepper: stepper_y1
#heater: extruder
pin: PB1
max_power: 0.6
shutdown_speed: 0
kick_start_time: 0.5
off_below: 0.45 #for 0.6 max power
#idle_timeout: 60
#fan_speed: 0.4
#tachometer_pin: PF10  #^PG9
#tachometer_ppr: 2

[fan_generic radiator_fan]
##  RSCS Fans - In FAN1 Positon
pin: PD14
#cycle_time: 0.001
#hardware_pwm: false
max_power: 1
shutdown_speed: 0
kick_start_time: 0.1
#off_below: 0.6

[controller_fan dummy_motors_fan]
##  RSCS Fans - In FAN1 Positon
pin: PD6
#heater: extruder
heater: heater_bed
stepper: stepper_x
stepper: stepper_x1
stepper: stepper_y
stepper: stepper_y1
#cycle_time: 0.001
#hardware_pwm: false
max_power: 1
shutdown_speed: 0
kick_start_time: 0.5
idle_timeout: 0
#off_below: 0.6

[heater_fan dummy_hotend_fan]
###	Hotend Fan - FAN0 Connector
### in case of a watercooler that is 24V use a Heater Pin like PF7 Heat3 for a larger mosfet that can handle more amps.
pin: PA8 #cerpadlo
max_power: 1
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0

