[temperature_sensor drivers_temp]
sensor_type: NTC 100K MGB18-104F39050L32
pullup_resistor: 4700
sensor_pin: PC0
min_temp: 0
max_temp: 55
#gcode_id: C: C

[temperature_sensor motors_temp]
sensor_type: NTC 100K MGB18-104F39050L32
pullup_resistor: 4700
sensor_pin: PF10
min_temp: 0
max_temp: 60
